import {
    APP_COMPONENTS,
} from '@/public/constant';

export default {
    name:'',
    data() {
      return {
      };
    },
    props: {
        tabList: {
            type: Object,
        },
        tabActive: {
            type: String,
        },
    },
    computed: {
        componentActive() {
            const activeC = this.tabList[this.tabActive].componentName;

            return activeC ? APP_COMPONENTS[activeC] : APP_COMPONENTS['NotFound'];
        }
    },
}
